import React from "react";
import {Route, Routes} from "react-router-dom";
import UpravljanjeNalozima from "./pages/Admin/UpravljanjeNalozima";
import './App.css';

function App() {
  return (
      <Routes>
          <Route exact path={"/upravljanjeNalozima"}>
              <UpravljanjeNalozima />
          </Route>
      </Routes>

  );
}

export default App;
